(async function() {
	const [wasmImport, wasmBinary] = await Promise.all([
		import('https://unpkg.com/@splinetool/runtime@0.9.473/build/' + 'navmesh.js'),
		fetch('https://unpkg.com/@splinetool/navmesh-wasm@0.9.473/build/' + 'navmesh.wasm').then((res) => res.arrayBuffer()),
	]);
	const wasmModule = wasmImport.default;
	self.module = await wasmModule({ wasmBinary });
	postMessage('ready');
})();
